releases/0/tender/description:
This contract covers the provision of a Microsoft Enterprise Agreement. This is a call-off contract let under the NHS Shared Business Services (NHSSBS) Digital Workplace Solutions (Ref: SBS / 19 / AB / WAB / 9411) framework agreement.

The scope covers a reselling and specialist advice service for all Microsoft products and services, including the entering into and management of a Microsoft Enterprise Agreement (and any subscriptions/products available within this).  This allows NHSBSA to fulfil all of its Microsoft needs in relation to licencing, cloud hosting and associated services throughout the term.

Orders to cover any of the above can be placed at any point throughout the term. However, the contract will initially cover Azure hosting, Microsoft support services and a wide range of subscription licences including but not limited to the following areas:
* Office365;
* Dynamics365;
* Power platform;
* Dataverse;
* Server licencing; and
* Specialist applications.

The Supplier is to provide a total service of Dishwasher and Water Softener Unit Maintenance and the relevant consumables for both the Catering Department at Arrowe Park Hospital, Upton and Clatterbridge Hospital, Bebington. The Supplier must provide but will not be limited to a copy of a full risk assessment on how they will provide the dishwasher and water softener unit maintenance and consumables for the Catering Department for Arrowe Park Hospital and Clatterbridge Hospital.
Types of Maintenance and Consumables may include but are not limited to:
• Maintenance of Dishwashers;
• Maintenance of Softener Units;
• Detergents;
• Rising Agents;
• Degreasers;
• Sanitisers;
• Bottles;
• Floor and Surface Cleaners; and
• Glass and Stainless Steel Cleaners.

The Contract relates to the provision of 'social and other specific services' within the
meaning of Schedule 3 of the Public Contracts Regulations 2015 (SI 2015/102) and is critical
to the provision of statutory "ESA" and Universal Credit welfare and other benefits for both
DWP and Other Government Departments. The supplier will carry out an objective and independent assessment of the impact of health conditions and disabilities on claimants
which is essential to the process of determining entitlement to these benefits. The supplier
will carry out this assessment and provide information and advice to support the Authority's
decision making processes.
The key elements of the service will include:
- The consideration of a claimant's health conditions or disabilities and the impact on their
capability to work;
- Assessing individuals against criteria prescribed by the Authority;
- The delivery of functional assessments to support the above;
- The gathering and consideration of evidence to support the above including, where
necessary, paying appropriate fees to gather evidence;
- The completion of reports, including advice, to the Authority and other Government
Departments;
- The referral of assessment reports and any associated evidence to the Authority;
- Interpretation and advice to the Authority on technical evidence;
- Follow up liaison with the Authority in relation to assessments, including the provision of
relevant health professional expertise as required;
- The administration and management of the service, including scheduling face-to-face
assessments, ensuring they are completed within the timescales set down by the Authority;
- The recruitment, training and ongoing support of healthcare professionals, including liaison
with relevant professional bodies;
- The development of guidance in conjunction with the Authority;
- The provision of an enquiry service for individuals being assessed;
- The provision of a quality control regime, including a complaints function;
- The provision of management information as defined by the Authority;
- Initiatives and liaison with relevant organizations to support the provision of evidence;
- Liaison and working with local and national partners, including disability organisations, and health professional bodies; and
- Support for Test and Learn activity
